import React, {useState, useEffect} from 'react';
import Login from './authentication/Login';
import Signup from './authentication/Signup';
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom';
import './App.css';
import 'fontsource-roboto';
import {Typography, Button, IconButton, AppBar, Toolbar} from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles'

const App = () => {
  const [user, setUser] = useState({})
  const [loggedIn, setLoggedIn] = useState(false)

  const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

  const classes = useStyles();
  return (
    <div className={classes.root}>
      {/* <header className="App-header">
        Welcome to FlatTrackerPal
      </header> */}
      <Router>

      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title} >
            Home
          </Typography>
          <Button color="primary"><Link to= "/login">Log In</Link></Button>
          <Button color="primary"><Link to= "/signup">Sign Up</Link></Button>
          <Button color="primary"><Link to= "/logout">Log Out</Link></Button>
        </Toolbar>
      </AppBar>
        <br/>
        <Switch>
          <Route exact path='/'>
          </Route>
          <Route exact path='/login'>
            {loggedIn ? <Redirect to="/" /> : <Login />}
          </Route>
          <Route exact path='/signup'>
            {loggedIn ? <Redirect to="/" /> : <Signup />}
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
